import React from 'react';

const TextItem = (props) => {
    return (
        <div>
            <div>
                <strong>{props.text.id}. {props.text.title}</strong>
                <div>
                    {props.text.body}
                </div>
                <button>вывод текста</button>
            </div>
        </div>
    );
};

export default TextItem;
